
def is_str_subsequence(s: str, t: str) -> bool:
    if len(s) > len(t):
        return False
    if len(s) == 0:
        return True

    index_s = 0
    index_t = 0

    while index_s < len(s) and index_t < len(t):
        if s[index_s] == t[index_t]:
            index_s += 1
            index_t += 1
        else:
            index_t += 1

    return index_s == len(s)


s1 = "abc"
t1 = "ahbgdc"

s2 = "axc"
t2 = "ahbgdc"

s3 = "ab"
t3 = "baab"

s4 = "leeeeetcode"
t4 = ""

print(is_str_subsequence(s1, t1))
print(is_str_subsequence(s2, t2))
print(is_str_subsequence(s3, t3))
print(is_str_subsequence(s4, t4))